const e=JSON.parse('{"key":"v-6d5686a6","path":"/posts/android/Android-Studio/2.html","title":"调试工具","lang":"zh-CN","frontmatter":{"lastUpdated":true,"description":"调试工具 日志Log与Toast Log给开发者看的提示信息要调用Log类的相应方法，日志打印结果可在Android Studio界面下方的logcat小窗口查看。Log类各种方法的区别在于日志的等级，具体说明如下。 Log.e：表示错误信息，比如可能导致程序崩溃的异常。 Log.w：表示警告信息。 Log.i：表示一般消息。 Log.d：表示调试信息，可把程序运行时的变量值打印出来，方便跟踪调试。 Log.v：表示冗余信息。","head":[["meta",{"property":"og:url","content":"https://eaaomk.github.io/blognext/blognext/posts/android/Android-Studio/2.html"}],["meta",{"property":"og:site_name","content":"欢迎你"}],["meta",{"property":"og:title","content":"调试工具"}],["meta",{"property":"og:description","content":"调试工具 日志Log与Toast Log给开发者看的提示信息要调用Log类的相应方法，日志打印结果可在Android Studio界面下方的logcat小窗口查看。Log类各种方法的区别在于日志的等级，具体说明如下。 Log.e：表示错误信息，比如可能导致程序崩溃的异常。 Log.w：表示警告信息。 Log.i：表示一般消息。 Log.d：表示调试信息，可把程序运行时的变量值打印出来，方便跟踪调试。 Log.v：表示冗余信息。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-03-14T13:11:33.000Z"}],["meta",{"property":"article:modified_time","content":"2023-03-14T13:11:33.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"调试工具\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-03-14T13:11:33.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"日志Log与Toast","slug":"日志log与toast","link":"#日志log与toast","children":[]},{"level":2,"title":"DeviceManager","slug":"devicemanager","link":"#devicemanager","children":[]},{"level":2,"title":"Device File Explorer","slug":"device-file-explorer","link":"#device-file-explorer","children":[]},{"level":2,"title":"APP Inspection","slug":"app-inspection","link":"#app-inspection","children":[]}],"git":{"createdTime":1678457949000,"updatedTime":1678799493000,"contributors":[{"name":"qiang.zhang","email":"eaaomk@163.com","commits":3}]},"readingTime":{"minutes":0.84,"words":253},"filePathRelative":"posts/android/Android-Studio/2.md","localizedDate":"2023年3月10日","excerpt":"<h1> 调试工具</h1>\\n<h2> 日志Log与Toast</h2>\\n<ol>\\n<li>Log给开发者看的提示信息要调用Log类的相应方法，日志打印结果可在Android Studio界面下方的logcat小窗口查看。Log类各种方法的区别在于日志的等级，具体说明如下。</li>\\n</ol>\\n<div class=\\"language-mk line-numbers-mode\\" data-ext=\\"mk\\"><pre class=\\"language-mk\\"><code>Log.e：表示错误信息，比如可能导致程序崩溃的异常。\\nLog.w：表示警告信息。\\nLog.i：表示一般消息。\\nLog.d：表示调试信息，可把程序运行时的变量值打印出来，方便跟踪调试。\\nLog.v：表示冗余信息。\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div>","autoDesc":true}');export{e as data};
